,"source":["# Identify data percentage by platform (Netflix, Amazon Prime, Disney, Hulu)\n","\n","# Calculate percentages\n","data_summary <- data_df %>% count(platform) %>% mutate(percentage = round(n / sum(n) * 100))\n","# print(data_summary)\n","\n","options(repr.plot.width = 20, repr.plot.height = 8)\n","\n","# Plot pie chart with ggplot2\n","pie_chart <- ggplot(data_summary, aes(x = \"\", y = n, fill = platform)) +\n","    geom_bar(width = 1, stat = \"identity\") +\n","    coord_polar(\"y\") +\n","    theme_void() + \n","    geom_text(aes(label = paste0(percentage, \"%\")), position = position_stack(vjust = 0.5), size = 8) +\n","    labs(title = \"Platform Distribution\") +\n","    theme(\n","      plot.title = element_text(hjust = 0.5, vjust = 1, size = 20, face = \"bold\"),\n","      legend.title = element_text(size = 20),\n","      legend.text = element_text(size = 15),\n","      legend.margin = margin(t = 0, r = 20, b = 0, l = 0)\n","    )\n","\n","print(pie_chart)"]},{"cell_type":"code","execution_count":16,"id":"e0be8f70","metadata":{"execution":{"iopub.execute_input":"2024-11-07T01:28:21.632782Z","iopub.status.busy":"2024-11-07T01:28:21.630988Z","iopub.status.idle":"2024-11-07T01:28:22.187633Z","shell.execute_reply":"2024-11-07T01:28:22.184972Z"},"papermill":{"duration":0.578537,"end_time":"2024-11-07T01:28:22.191134","exception":false,"start_time":"2024-11-07T01:28:21.612597","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ4AUReI34JlN5JyDgIAgIJINKEYMgKcgZ7xDET3DKd6ZRdRTMQCnYsDsmTg8\n0wlnxJwVRTGSRQkiSJIcNs37gf+LONO7O2xe+nk+zdZUV1f3Ftu786OqorFYLAIAAAAAAACE\nQ0pZdwAAAAAAAAAoPQJCAAAAAAAACBEBIQAAAAAAAISIgBAAAAAAAABCREAIAAAAAAAAISIg\nBAAAAAAAgBAREAIAAAAAAECIpJV1BwAAgKT8MuuTV954+/0PP5s9b96PP/2yfv36rbG0GjVq\n1G3UvF27dp179O7b9/DD9+uYWtb9BAAAAMq5aCwWK+s+AAAAeYtlvvXvcWPuuO+N6QsLrFuj\nRfehZ/31isuGNqssKOR3fp13Zt12j5REyw8v23hmo6ol0fIuaevadyrXPizJytHUtMqVKlep\nXqtx